package templates

//EnumsTemplate is the template for generating enums
var EnumsTemplate = `{{- $template := . -}}
// *********************************
// Code generated by sdkgen
// DO NOT EDIT!.
//
// Enums.
// *********************************
{{ range $enum := $template.Enums }}
export enum {{ $enum.Name }} {
	{{- range $enumVal := $enum.Value }}
	{{ $enumVal.Name }} = {{ $enumVal.Number -}},
	{{- end }}
}
{{ end -}}
`
